import React, { useState, useEffect } from 'react';

const WorkerSignup = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    password: '',
    workSpecification: '',
    experience: '',
    location: '',
    photo: '',
    latitude: null,
    longitude: null,
  });

  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const [signupType, setSignupType] = useState('worker'); // either 'user' or 'worker'

  useEffect(() => {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          setFormData((prev) => ({
            ...prev,
            latitude: position.coords.latitude,
            longitude: position.coords.longitude,
          }));
        },
        (err) => {
          console.error('Error getting location:', err);
          setError('Could not get your location');
        }
      );
    } else {
      setError('Geolocation is not supported by your browser');
    }
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');

    if (!formData.name || !formData.email || !formData.password) {
      setError('Name, email, and password are required');
      return;
    }

    try {
      const res = await fetch('http://localhost:5000/api/workers/signup', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData),
      });

      const data = await res.json();
      if (!res.ok) {
        setError(data.message || 'Signup failed');
      } else {
        setSuccess('Signup successful! You can now log in.');
        setFormData({
          name: '',
          email: '',
          password: '',
          workSpecification: '',
          experience: '',
          location: '',
          photo: '',
          latitude: formData.latitude,
          longitude: formData.longitude,
        });
      }
    } catch (err) {
      setError('Server error: ' + err.message);
    }
  };

  return (
    <div style={styles.container}>
      <div style={styles.toggle}>
        <button
          style={signupType === 'worker' ? styles.activeToggle : styles.inactiveToggle}
          onClick={() => setSignupType('worker')}
        >
          Worker Signup
        </button>
        <button
          style={signupType === 'user' ? styles.activeToggle : styles.inactiveToggle}
          onClick={() => setSignupType('user')}
        >
          User Signup
        </button>
      </div>

      <h2 style={styles.heading}>{signupType === 'worker' ? 'Worker Signup' : 'User Signup'}</h2>

      {error && <p style={styles.error}>{error}</p>}
      {success && <p style={styles.success}>{success}</p>}

      <form onSubmit={handleSubmit} style={styles.form}>
        <input
          name="name"
          type="text"
          placeholder="Full Name"
          value={formData.name}
          onChange={handleChange}
          required
          style={styles.input}
        />
        <input
          name="email"
          type="email"
          placeholder="Email"
          value={formData.email}
          onChange={handleChange}
          required
          style={styles.input}
        />
        <input
          name="password"
          type="password"
          placeholder="Password"
          value={formData.password}
          onChange={handleChange}
          required
          style={styles.input}
        />

        {signupType === 'worker' && (
          <>
            <input
              name="workSpecification"
              type="text"
              placeholder="Work Specification"
              value={formData.workSpecification}
              onChange={handleChange}
              style={styles.input}
            />
            <input
              name="experience"
              type="number"
              placeholder="Experience (years)"
              value={formData.experience}
              onChange={handleChange}
              style={styles.input}
            />
            <input
              name="location"
              type="text"
              placeholder="Location (e.g. city)"
              value={formData.location}
              onChange={handleChange}
              style={styles.input}
            />
            <input
              name="photo"
              type="text"
              placeholder="Photo URL"
              value={formData.photo}
              onChange={handleChange}
              style={styles.input}
            />
          </>
        )}

        <button type="submit" style={styles.button}>
          Sign Up
        </button>
      </form>

      {signupType === 'worker' && (
        <p style={styles.coordinates}>
          Your current latitude: {formData.latitude || 'Fetching...'} <br />
          Your current longitude: {formData.longitude || 'Fetching...'}
        </p>
      )}
    </div>
  );
};

const styles = {
  container: {
    maxWidth: '500px',
    margin: '40px auto',
    padding: '20px',
    background: '#f8f8f8',
    borderRadius: '10px',
    boxShadow: '0 0 10px rgba(0,0,0,0.1)',
    fontFamily: 'Arial, sans-serif',
  },
  toggle: {
    display: 'flex',
    justifyContent: 'center',
    marginBottom: '15px',
  },
  activeToggle: {
    flex: 1,
    padding: '10px',
    background: '#333',
    color: '#fff',
    border: 'none',
    cursor: 'pointer',
    fontWeight: 'bold',
  },
  inactiveToggle: {
    flex: 1,
    padding: '10px',
    background: '#ccc',
    color: '#333',
    border: 'none',
    cursor: 'pointer',
  },
  heading: {
    textAlign: 'center',
    marginBottom: '20px',
    color: '#222',
  },
  form: {
    display: 'flex',
    flexDirection: 'column',
  },
  input: {
    padding: '10px',
    marginBottom: '12px',
    borderRadius: '5px',
    border: '1px solid #ccc',
  },
  button: {
    padding: '12px',
    backgroundColor: '#007bff',
    color: '#fff',
    fontWeight: 'bold',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
  },
  coordinates: {
    marginTop: '15px',
    fontSize: '0.9rem',
    color: '#444',
    textAlign: 'center',
  },
  error: {
    color: 'red',
    textAlign: 'center',
    marginBottom: '10px',
  },
  success: {
    color: 'green',
    textAlign: 'center',
    marginBottom: '10px',
  },
};

export default WorkerSignup;
